import styled from './Header.module.css'
import src from '../assets/meals.jpg'
const Header = () =>{
    return (
        <div className={styled.header}>
            <div className={styled.nav}>
                <a href='/'><h1>ReactMeals</h1></a>
            </div>
            <img src={src}/>
        </div>
    )
}
export default Header
